import React from 'react';
import { Link } from "react-router-dom";
import './css/Navbar.css';


const Navbar = () => {

  return (
    <nav id="navbar" className="navbar shadow navbar-expand-md navbar-custom bg-light sticky-top scrolling-navbar">
      <div id="navLogo">
        <Link>
          <img id ="logo" src={`${process.env.PUBLIC_URL}/Pictures/logo.png`} alt='logo'/>
          Wild Circus 2.0 <span className="sr-only">(current)</span>
        </Link> 
      </div>
      <div id="navMenu">
          <div>
            <Link to="/gallery">
              Galerie 
            </Link>
            <Link to="/visitor">
              Livre d'or
            </Link>
            <Link to="/showDate">
              Nos dates 
            </Link>
          </div>
      </div>
    </nav>
  );
}

export default Navbar;
